const fs = require("fs");

function saveBinaryAsImage(binary, outputPath) {
  const base64Data = binary.base64;
  const subType = binary.subType;

  const data = base64Data.replace(/^data:image\/(png|jpeg|jpg);base64,/, "");
  const buffer = Buffer.from(data, "base64");

  fs.writeFileSync(outputPath, buffer, "binary");
  console.log("Image saved successfully.");
}

// Usage example
const binary = {
  base64:
    "",
  subType: "00",
};
const outputPath = "./binaryimage.png";

saveBinaryAsImage(binary, outputPath);
